<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <meta http-equiv="X-UA-Compatible" content="ie=edge">
  <title>Video Player - Video Player</title>
  <link rel="stylesheet" href="https://studyraysofficial.pages.dev/player/pyyari.css">
  <link rel="stylesheet" href="https://studyraysofficial.pages.dev/player/plyr23.css">
