  <style>
    :root {
      --primary-color: #111111;
      --accent-color: #5a4bda;
      --text-color: #f5f5f5;
      --card-bg-color: #1c1c1c;
      --card-border-color: #292929;
      --card-border-color-active: #5a4bda;
      --card-shadow: 0 4px 12px rgba(0, 0, 0, 0.3);
    }
    
    body {
      background-color: var(--primary-color);
      color: var(--text-color);
      font-family: 'Arial', sans-serif;
      min-height: 100vh;
      margin: 0;
      padding: 0;
    }
    
    .container {
      max-width: 1200px;
      margin: 0 auto;
      padding: 20px;
    }
    
    /* Player customization */
    html {
      --plyr-color-main: var(--accent-color);
    }
    
    /* Disable highlight effect */
    .plyr__controls button:focus {
      outline: none;
      box-shadow: none;
    }

    /* Disable text selection in controls */
    .plyr__controls {
      user-select: none;
    }

    /* Disable focus styles for the control buttons */
    .plyr__controls button {
      pointer-events: auto;
      cursor: pointer;
    }
    
    video {
      width: 100%;
      border-radius: 8px;
      box-shadow: var(--card-shadow);
      display: none;
      max-height: 80vh;
      object-fit: contain;
    }

    /* WebM specific optimizations */
    video[type*="webm"] {
      display: block;
      background-color: #000;
    }

    video.ready {
      display: block;
    }
    
    /* Video info card */
    .video-info-card {
      background-color: var(--card-bg-color);
      border: 1px solid var(--card-border-color);
      border-radius: 10px;
      padding: 20px;
      margin: 20px auto;
      box-shadow: var(--card-shadow);
      transition: all 0.3s ease;
    }
    
    .video-info-card:hover {
      border-color: var(--card-border-color-active);
      transform: translateY(-2px);
    }
    
    .video-info-card h3 {
      margin-top: 0;
      margin-bottom: 10px;
      font-size: 1.5rem;
      color: var(--text-color);
      text-align: center;
    }
    
    /* Badge styles */
    .badge-container {
      display: flex;
      justify-content: center;
      margin-top: 15px;
    }
    
    /* Spinner styles */
    .loading-overlay {
      position: fixed;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      background-color: rgba(0, 0, 0, 0.8);
      display: flex;
      flex-direction: column;
      align-items: center;
      justify-content: center;
      z-index: 9999;
      opacity: 1;
      transition: opacity 0.5s ease;
    }

    .loading-overlay.hidden {
      opacity: 0;
      pointer-events: none;
    }
    
    .loader {
      width: 48px;
      height: 48px;
      background: #353535;
      display: block;
      margin: 20px auto;
      position: relative;
      box-sizing: border-box;
      animation: rotationBack 1s ease-in-out infinite reverse;
    }

    .loader::before {
      content: '';
      box-sizing: border-box;
      left: 0;
      top: 0;
      transform: rotate(45deg);
      position: absolute;
      width: 48px;
      height: 48px;
      background: #2e2e2e;
      box-shadow: 0 0 5px rgba(0, 0, 0, 0.15);
    }

    .loader::after {
      content: '';
      box-sizing: border-box;
      width: 32px;
      height: 32px;
      border-radius: 50%;
      position: absolute;
      left: 50%;
      top: 50%;
      background: rgb(0, 0, 0);
      transform: translate(-50%, -50%);
      box-shadow: 0 0 5px rgba(0, 0, 0, 0.15);
    }
    
    /* Loading text */
    .loading-text {
      color: var(--text-color);
      margin-top: 20px;
      font-size: 16px;
    }

    /* Error message */
    .error-message {
      background-color: #ff3333;
      color: white;
      padding: 15px;
      border-radius: 8px;
      margin: 20px auto;
      max-width: 80%;
      text-align: center;
      display: none;
    }

    @keyframes rotationBack {
      0% {
        transform: rotate(0deg);
      }
      100% {
        transform: rotate(-360deg);
      }
    }
    
    /* Responsive adjustments */
    @media (max-width: 768px) {
      .container {
        padding: 15px;
      }
      
      .video-info-card {
        padding: 15px;
      }
      
      .video-info-card h3 {
        font-size: 1.3rem;
      }
    }
  </style>
</head>
<body>
  <div class="container">
    <!-- Loading spinner -->
    <div class="loading-overlay" id="loading-spinner">
      <div class="loader"></div>
      <div class="loading-text">Loading video, please wait...</div>
    </div>
    
    <!-- Error message display -->
    <div class="error-message" id="error-message">
          </div>
    
    <!-- Video player -->
    <video 
      class="player" 
      controls 
      crossorigin 
      playsinline
            style="--plyr-range-track-height: 2px; --plyr-control-icon-size: 35px">
          </video>
    
    <!-- Video info card -->
    <div class="video-info-card">
      <h3>Video Player</h3>
    </div>
    <br>
        <center><div class="video-title" id="countdown"></div></center>
        
    <!-- Counter badge -->
    <div class="badge-container">
